import React from "react";
import avatar from "../WhatsApp Image 2022-09-13 at 22.42.58.jpg"
import SkillCard from "./SkillCard";
// import logo from "../logo.svg"
import skillset from "../skills"

export default function MainContent(){
    // console.log(skillset)
    const skills = skillset.map(item =>{
        return(
         <SkillCard key={item.id} item={item} />
        )
    }
    )
    return(
        <div>
            <div className="main-items">
                <div className="text-intro" data-aos = "fade-up">
                    <h1 id="welcome">Hello, I am Mohammad Adnan</h1>
                    <p id="brief-intro">I am a software developer and a content creator based in India.</p>
                </div>
                <div id="avatar" data-aos = "fade-up">
                    <img src={avatar} alt="" />
                </div>
            </div>
            <h3 id="skill-heading" data-aos = "fade-up">SKILLS</h3>
            <section id="skills" data-aos = "zoom-in-up">
                {skills}
            </section>
        </div>
    )
}
